JEFE DE DEPARTAMENTO DE INVERSION FISICA
I. IMPLEMENTAR, EN EL ÁMBITO DE SUS ATRIBUCIONES, LOS CRITERIOS, PROCEDIMIENTOS Y REGLAS PARA LA ADECUADA INTEGRACIÓN DE LOS ELEMENTOS TÉCNICOS, JURÍDICOS Y ADMINISTRATIVOS QUE DEBEN OBTENER LOS SERVIDORES PÚBLICOS DURANTE LA EJECUCIÓN DE LOS ACTOS DE FISCALIZACIÓN;

II. LLEVAR A CABO EL PROGRAMA ANUAL DE AUDITORÍAS PARA LA ELABORACIÓN OPORTUNA DEL INFORME DE RESULTADOS;

III. VERIFICAR QUE LOS SERVIDORES PÚBLICOS A SU CARGO DEN CUMPLIMIENTO AL PROGRAMA ANUAL DE AUDITORÍAS;

IV. VERIFICAR LA ELABORACIÓN DE LOS OFICIOS PARA CONVOCAR A LOS TITULARES DE LAS ENTIDADES FISCALIZABLES A LOS ACTOS PROTOCOLARIOS, Y SOLICITAR LA DESIGNACIÓN DE MANERA OFICIAL DE UN REPRESENTANTE, UN ENLACE Y DOS TESTIGOS, Y REMITIR DICHOS OFICIOS A SU SUPERIOR JERÁRQUICO;

V. LLEVAR A CABO LOS ACTOS DE FISCALIZACIÓN APEGADOS A LAS NORMAS PROFESIONALES DE AUDITORÍA DEL SISTEMA NACIONAL DE
FISCALIZACIÓN;

VI. LLEVAR A CABO LOS ACTOS DE FISCALIZACIÓN ORDENADOS POR LA COMISIÓN, A FIN DE RENDIR EL INFORME DE AUDITORÍA QUE CORRESPONDA;

VII. PROPONER A SU SUPERIOR JERÁRQUICO LOS SERVIDORES PÚBLICOS QUE REALIZARÁN ACTOS DE FISCALIZACIÓN SUPERIOR Y, EN SU CASO, MODIFICAR LA INTEGRACIÓN DEL GRUPO DE AUDITORÍA;

VIII. PARTICIPAR EN LAS DILIGENCIAS QUE REQUIERAN LOS ACTOS DE FISCALIZACIÓN, PRACTICADAS POR LOS SERVIDORES PÚBLICOS A SU CARGO;

IX. VERIFICAR O, EN SU CASO, LLEVAR A CABO LOS ACTOS DE FISCALIZACIÓN, ESTUDIOS, ANÁLISIS, DIAGNÓSTICOS, EVALUACIONES E INVESTIGACIONES AL CONTROL INTERNO, AL MANEJO DE LOS RECURSOS PÚBLICOS ESTATALES Y MUNICIPALES Y, EN SU CASO, LAS PARTICIPACIONES FEDERALES QUE SE HAYAN OTORGADO A LOS SUJETOS DE FISCALIZACIÓN CUALESQUIERA QUE SEAN SUS FINES Y DESTINO, PARA VIGILAR:

A) LA EFECTIVIDAD DEL CONTROL INTERNO, DIRIGIDO A VERIFICAR LA EFICACIA Y EFICIENCIA DE LAS OPERACIONES;
B) LA GENERACIÓN, ACTUALIZACIÓN, UTILIZACIÓN O DISPOSICIÓN DE INFORMACIÓN FINANCIERA;
C) LA EFECTIVIDAD TÉCNICA DE LAS TECNOLOGÍAS DE LA INFORMACIÓN Y COMUNICACIONES;
D) EL CUMPLIMIENTO DE LAS DISPOSICIONES JURÍDICAS APLICABLES, Y
E) EL RESGUARDO DE LOS ACTIVOS.

A FIN DE ATENDER LO QUE LES CORRESPONDA EN EL EJERCICIO DE SUS ATRIBUCIONES.

X. 	VERIFICAR, EN MATERIA DE DESEMPEÑO Y FINANCIERAMENTE, LOS PROYECTOS DE ASOCIACIÓN PÚBLICO PRIVADA DE LAS POLÍTICAS PÚBLICAS, PROGRAMAS Y ACCIONES DE DESARROLLO SOCIAL; DE LOS PROGRAMAS SECTORIALES ALINEADOS A LA AGENDA DIGITAL; DEL USO DE RECURSOS FINANCIEROS EN LA INVERSIÓN EN MATERIA DE TECNOLOGÍAS DE LA INFORMACIÓN Y COMUNICACIÓN; ASÍ COMO DE AQUELLOS EN MATERIA DE SEGURIDAD PÚBLICA, Y LOS DEMÁS QUE DETERMINEN LAS LEYES;

XI. LLEVAR A CABO LA FISCALIZACIÓN DE LAS INVERSIONES FÍSICAS, OBRAS, BIENES ADQUIRIDOS Y SERVICIOS CONTRATADOS, PARA COMPROBAR SI LAS INVERSIONES Y GASTOS AUTORIZADOS A LAS ENTIDADES FISCALIZADAS SE HAN EFECTUADO CON SUJECIÓN A LAS DISPOSICIONES JURÍDICAS APLICABLES PARA EL LOGRO DE LOS OBJETIVOS Y METAS DE LOS PROGRAMAS APROBADOS;

XII. EJECUTAR LOS ACTOS D FISCALIZACIÓN A LOS AVANCES DE LOS PROGRAMAS SECTORIALES A FIN DE COMPROBAR QUE SE ENCUENTREN ALINEADOS A LA AGENDA DIGITAL; ASÍ COMO DEL USO DE RECURSOS FINANCIEROS EN LA INVERSIÓN EN MATERIA DE TECNOLOGÍAS DE LA INFORMACIÓN Y COMUNICACIÓN;

XIII. LLEVAR A CABO LOS ACTOS DE FISCALIZACIÓN AL FONDO ESTATAL DE DESAPARICIÓN;

XIV. VERIFICAR EL NIVEL DE TRANSPARENCIA Y RENDICIÓN DE CUENTAS EN LAS ENTIDADES FISCALIZABLES Y PRESENTAR, A SU SUPERIOR JERÁRQUICO, LAS ACCIONES DE MEJORA TENDENTES AL FORTALECIMIENTO INSTITUCIONAL;

XV. 	ANALIZAR Y EVALUAR LA IMPLEMENTACIÓN DE LOS MECANISMOS DE CONTROL INTERNO, ADMINISTRACIÓN DE RIESGOS, POLÍTICAS Y PROGRAMAS DE INTEGRIDAD, PREVENCIÓN, DISUASIÓN Y DETECCIÓN DE ACTOS DE CORRUPCIÓN EN EL SECTOR PÚBLICO, QUE REALICEN LAS ENTIDADES FISCALIZABLES;

XVI. SUPERVISAR QUE EL ACTUAR DE LAS ENTIDADES FISCALIZABLES SE APEGUE A LAS DISPOSICIONES LEGALES Y NORMATIVIDAD APLICABLE;

XVII. PROPONER A SU SUPERIOR JERÁRQUICO LOS SERVIDORES PÚBLICOS QUE EFECTUARÁN VISITAS DE VERIFICACIÓN PARA REQUERIR LA EXHIBICIÓN DE LOS LIBROS, PAPELES, CONTRATOS, CONVENIOS, NOMBRAMIENTOS, DISPOSITIVOS MAGNÉTICOS, ELECTRÓNICOS O DIGITALES DE ALMACENAMIENTO DE INFORMACIÓN, DOCUMENTOS Y ARCHIVOS INDISPENSABLES PARA LA REALIZACIÓN DE SUS INVESTIGACIONES, SUJETÁNDOSE A LAS LEYES RESPECTIVAS, ASÍ COMO REALIZAR ENTREVISTAS Y REUNIONES CON PARTICULARES O CON LOS SERVIDORES PÚBLICOS DE LAS ENTIDADES FISCALIZABLES, NECESARIAS PARA CONOCER DIRECTAMENTE EL EJERCICIO DE SUS FUNCIONES;

XVIII. VERIFICAR O, EN SU CASO, ELABORAR EL REQUERIMIENTO DE INFORMACIÓN A LAS ENTIDADES FISCALIZABLES, Y EN SU CASO A TERCEROS QUE HUBIEREN CELEBRADO OPERACIONES CON AQUÉLLAS, QUE SEA NECESARIA PARA COMPLEMENTAR LA RECEPCIÓN, REVISIÓN, FISCALIZACIÓN O CUALQUIER OTRO ACTO DE SU COMPETENCIA;

XIX. VERIFICAR O, EN SU CASO, ELABORAR LAS SOLICITUDES A LAS ENTIDADES FISCALIZABLES, SERVIDORES PÚBLICOS Y A LOS PARTICULARES, SEAN ÉSTOS PERSONAS FÍSICAS O JURÍDICO COLECTIVAS, DE LA INFORMACIÓN QUE SE REQUIERA CON MOTIVO DE LA FISCALIZACIÓN;

XX. 	OBTENER, DURANTE EL DESARROLLO DE LOS ACTOS DE FISCALIZACIÓN, INVESTIGACIONES O EN EL EJERCICIO DE SUS ATRIBUCIONES, COPIA CERTIFICADA DE LA INFORMACIÓN Y SOPORTE DOCUMENTAL, EN SU CASO, DE LAS CONSTANCIAS QUE TENGA A LA VISTA;

XXI. OBTENER COPIAS SIMPLES DE LOS DOCUMENTOS Y SOPORTE DOCUMENTAL RELACIONADOS CON LOS ACTOS DE FISCALIZACIÓN PRACTICADOS, PARA QUE, PREVIO COTEJO CON LOS ORIGINALES, SEAN AGREGADAS AL EXPEDIENTE;

XXII. PROPONER A SU SUPERIOR JERÁRQUICO LA AMPLIACIÓN DE LOS ACTOS DE FISCALIZACIÓN, LA CUAL DEBERÁ REALIZARSE DENTRO DEL PERIODO DE EJECUCIÓN DE LA AUDITORÍA, SIN EXCEDER EL PLAZO DE EJECUCIÓN DEL PROGRAMA ANUAL DE AUDITORÍAS CORRESPONDIENTE;

XXIII. IMPLEMENTAR LOS MECANISMOS DE EVALUACIÓN A LOS SISTEMAS DE CONTROL INTERNO DE LAS ENTIDADES FISCALIZABLES, PARA CONSTATAR QUE EXISTEN, SE APLICAN Y ESTÁN CORRECTAMENTE DISEÑADOS PARA SALVAGUARDAR SUS ACTIVOS Y RECURSOS;

XXIV. COADYUVAR CON SU SUPERIOR JERÁRQUICO EN LA COORDINACIÓN CON LOS ÓRGANOS INTERNOS DE CONTROL Y CON LAS DEPENDENCIAS GLOBALIZADORAS RESPONSABLES DE LA CONTABILIDAD Y AUDITORÍAS GUBERNAMENTALES, A EFECTO DE INTERCAMBIAR INFORMACIÓN Y MEJORAR LA CALIDAD DE LAS REVISIONES PRACTICADAS;

XXV. 	INFORMAR A SU SUPERIOR JERÁRQUICO EN CASO DE DETECTAR QUE LOS RECURSOS DE LOS FONDOS NO SE HAN DESTINADO A LOS FINES ESTABLECIDOS EN LA LEY DE COORDINACIÓN FISCAL, PARA LOS EFECTOS LEGALES PROCEDENTES;

XXVI. COORDINAR LA INTEGRACIÓN DE LA DOCUMENTACIÓN QUE LA AUDITORÍA SUPERIOR DE LA FEDERACIÓN O LA SECRETARÍA DE LA
FUNCIÓN PÚBLICA REQUIERAN SOBRE LOS RESULTADOS DE LA FISCALIZACIÓN, Y REMITIRLA A SU SUPERIOR JERÁRQUICO;

XXVII. VERIFICAR Y SOMETER A CONSIDERACIÓN DE SU SUPERIOR JERÁRQUICO LAS ACCIONES Y RECOMENDACIONES DERIVADAS DE LA FISCALIZACIÓN QUE PRACTIQUEN LOS SERVIDORES PÚBLICOS, EN EL ÁMBITO DE SU COMPETENCIA, A LAS ENTIDADES FISCALIZADAS;

XXVIII. VERIFICAR LA ELABORACIÓN DEL PROYECTO DE DICTAMEN TÉCNICO DE AUDITORÍA Y REMITIRLO A SU SUPERIOR JERÁRQUICO;

XXIX. VERIFICAR LOS INFORMES DE AUDITORÍA QUE ESPECIFIQUEN, DE MANERA FUNDADA Y MOTIVADA, LAS ACCIONES Y RECOMENDACIONES DERIVADAS DE LA FISCALIZACIÓN;

XXX. REVISAR LA ELABORACIÓN DE LOS INFORMES DE AUDITORÍA Y REMITIRLOS A SU SUPERIOR JERÁRQUICO PARA SU NOTIFICACIÓN;

XXXI. VERIFICAR LA INTEGRACIÓN DE LOS INFORMES DE AUDITORÍA Y LOS EXPEDIENTES POR CADA ACCIÓN Y RECOMENDACIÓN QUE SE DESPRENDA PARA SU ACLARACIÓN Y SEGUIMIENTO, Y REMITIRLOS A SU SUPERIOR JERÁRQUICO;

XXXII. HACER DEL CONOCIMIENTO DE SU SUPERIOR JERÁRQUICO LOS ACTOS U OMISIONES QUE, EN SU CASO, IMPLIQUEN EL INCUMPLIMIENTO DE LA NORMA, DERIVADO DE LA REVISIÓN DE LA INFORMACIÓN DE LAS ENTIDADES FISCALIZABLES;

XXXIII. SUPERVISAR LA IMPLEMENTACIÓN DE ACCIONES PARA LA ATENCIÓN DE LAS IRREGULARIDADES, ACTOS U OMISIONES DETECTADOS DURANTE EL DESARROLLO DE LOS ACTOS DE FISCALIZACIÓN POR PARTE DE LOS SERVIDORES PÚBLICOS DEL ÓRGANO SUPERIOR;

XXXIV. COORDINAR QUE LOS SERVIDORES PÚBLICOS A SU CARGO ELABOREN, DIGITALICEN, SUMINISTREN Y, EN SU CASO, ACTUALICEN LA INFORMACIÓN DE LA PLATAFORMA DIGITAL, PARA CONTROLAR LAS ACCIONES Y RECOMENDACIONES DERIVADAS DE LA FISCALIZACIÓN, Y REMITIRLA A SU SUPERIOR JERÁRQUICO;

XXXV. PROPONER A SU SUPERIOR JERÁRQUICO ACCIONES QUE PROPICIEN EL FORTALECIMIENTO DEL SISTEMA DE CONTROL INTERNO Y LA EVALUACIÓN DE LA GESTIÓN DE LAS ENTIDADES FISCALIZABLES, A EFECTO DE PREVENIR, DETECTAR Y DISUADIR ACTOS DE CORRUPCIÓN E INCORPORAR LAS MEJORES PRÁCTICAS EN DICHAS ENTIDADES, CONSIDERANDO, EN SU CASO, LAS POLÍTICAS QUE EMITA EL COMITÉ COORDINADOR, E IMPULSAR Y PROMOVER DICHAS ACCIONES EN EL MARCO DEL SISTEMA NACIONAL DE FISCALIZACIÓN;

XXXVI. PROPONER A SU SUPERIOR JERÁRQUICO ACCIONES DE MEJORA QUE SE DEBAN IMPLEMENTAR EN EL SISTEMA NACIONAL DE
FISCALIZACIÓN;

XXXVII. PROPONER A SU SUPERIOR JERÁRQUICO LAS MODIFICACIONES AL MANUAL ÚNICO DE CONTABILIDAD GUBERNAMENTAL, Y

XXXVIII. LAS DEMÁS QUE LE CONFIERAN OTROS ORDENAMIENTOS LEGALES, MANUALES, LAS DISPOSICIONES JURÍDICAS APLICABLES Y LAS QUE LES ASIGNE SU SUPERIOR JERÁRQUICO.
